import React from 'react'
import styled from 'styled-components'

const StyledNewQuoteButton = styled.div`
  button {
    border: none;
    background-color: transparent;
    outline: none;
    cursor: pointer;
    font-size: 20px;
  }
`;

function NewQuoteButton() {
  return (
    <StyledNewQuoteButton>
      <button
        className='new-quote'
        id='new-quote'
      >
        New Quote
      </button>
    </StyledNewQuoteButton>
  )
}

export default NewQuoteButton
